// avatar.js
class ProfilApp {
  constructor() {
    this.kisi = { svg: '' };
    this.pathObjects = { bg, yuz, ten, sac, goz, agiz, aks, sakal, govde, grenk };
    this.pathKeys = Object.keys(this.pathObjects);
    this.WHITE = '#ffffff';
    this.BLACK = '#000000';
  }

  init() {
    const dataElements = document.querySelectorAll('[avatar]');
    dataElements.forEach(element => {
      const urlParams = new URLSearchParams(window.location.search);
      const codeFromURL = urlParams.get('code');
      let avatarCode = '';
      if (codeFromURL && this.isValidCode(codeFromURL)) {
        avatarCode = codeFromURL;
        element.setAttribute('avatar', avatarCode);
        const sizeFromURL = urlParams.get('size');
        const radiusFromURL = urlParams.get('radius');
        const lineFromURL = urlParams.get('line');
        if (sizeFromURL) element.setAttribute('size', sizeFromURL);
        if (radiusFromURL) element.setAttribute('radius', radiusFromURL);
        if (lineFromURL) element.setAttribute('line', lineFromURL);
      } else {
        avatarCode = element.getAttribute('avatar') || '';
      }
      
      if (avatarCode && avatarCode.length === 10 && this.isValidCode(avatarCode)) {
        this.SVG(avatarCode.split(''), element);
        element.innerHTML = this.kisi.svg;
      }
    });
  }

  isValidCode(code) {
    if (code.length !== 10) return false;
    for (let i = 0; i < 10; i++) {
      const key = this.pathKeys[i];
      const value = code[i];
      if (!this.pathObjects[key][value]) {return false;}
    }
    return true;
  }

  SVG(c, element) {
    const bgRenk = bg[c[0]] || this.WHITE;
    const yuzKod = c[1]?.toLowerCase();
    const tenRenk = ten[c[2]?.toLowerCase()] || this.WHITE;
    const sacKod = c[3];
    const gozKod = c[4]?.toLowerCase();
    const agizKod = c[5]?.toLowerCase();
    const aksKod = c[6]?.toLowerCase();
    const sakalKod = c[7]?.toLowerCase();
    const govdeKod = c[8]?.toLowerCase();
    const govdeRenk = grenk[c[9]?.toLowerCase()] || this.WHITE;
    const radius = element.getAttribute('radius') || '25';
    const size = element.getAttribute('size') || '200';
    const line = element.getAttribute('line') || '10';
    const borderValue = `${line}px solid ${bgRenk}30`;
    let radiusValue = radius.includes('px') ? radius : radius + 'px';
    let sizeValue = size.includes('px') ? size : size + 'px';
    let avatarCode = c.join('');
    const style = `width: ${sizeValue}; height: ${sizeValue}; border-radius: ${radiusValue}; border: ${borderValue}; background: ${this.WHITE}00; display: block; margin: 0 auto; box-sizing: border-box;`;
    const svgBas = `<a href="./avatar/?code=${avatarCode}&size=${size}&radius=${radius}&line=${line}" target="_blank"><svg viewBox="0 0 300 300" fill="none" xmlns="http://www.w3.org/2000/svg" style="${style}">`;
    const svgFilter = `<defs><filter id="white-outline" x="-50" y="-50" width="350" height="350" filterUnits="userSpaceOnUse"><feMorphology in="SourceAlpha" operator="dilate" radius="${line}" result="dilated"/><feFlood flood-color="${this.WHITE}" result="white" /><feComposite in="white" in2="dilated" operator="in" result="outline"/><feMerge><feMergeNode in="outline"/><feMergeNode in="SourceGraphic"/></feMerge></filter></defs>`;
    const svgBackground = `<rect width="300" height="300" fill="${bgRenk}"/><g transform="translate(5, 0)" filter="url(#white-outline)">`;
    const yuzPath = `<g fill="${tenRenk}" stroke="${this.BLACK}" stroke-width="0">${yuz[yuzKod] || ''}</g>`;
    const sacPath = sac[sacKod] || '';
    const gozPath = goz[gozKod] || '';
    const agizPath = `<g transform="translate(6, 8)">${agiz[agizKod] || ''}</g>`;
    const govdePath = `<g fill="${govdeRenk}" stroke="${this.BLACK}" stroke-width="0">${govde[govdeKod] || ''}</g>`;
    const aksPath = aks[aksKod] || '';
    const sakalPath = sakal[sakalKod] || '';
    const svgSon = `</g></svg></a>`;
    this.kisi.svg = svgBas + svgFilter + svgBackground + govdePath + yuzPath + sacPath + agizPath + sakalPath + gozPath + aksPath + svgSon;
  }
}
window.ProfilApp = ProfilApp;
if (document.querySelector('[avatar]')) {
  document.addEventListener('DOMContentLoaded', () => {
    window.avatarApp = new ProfilApp();
    window.avatarApp.init();
  });
}

